import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Wait for and perform a search to get to a product list with price filter ---

    // Wait for the search input and enter a term (e.g., "iphone")
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iphone');

    // Wait for the search button and click it
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for the search results and price filter to appear
    await page.waitForSelector('.search-results', { timeout: 7000 });
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // --- Apply Price Range Filter ---

    // Wait for min and max price inputs
    await page.waitForSelector('#minPrice', { timeout: 3000 });
    await page.waitForSelector('#maxPrice', { timeout: 3000 });

    // Set min price to 500
    await page.fill('#minPrice', '');
    await page.type('#minPrice', '500');

    // Set max price to 1300
    await page.fill('#maxPrice', '');
    await page.type('#maxPrice', '1300');

    // Take screenshot before applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_entered.png'));

    // Click the "Apply" button
    const applyBtn = await page.$('.apply-filter');
    if (applyBtn) {
      await applyBtn.click();
    } else {
      throw new Error('Apply filter button not found');
    }

    // Wait for the product grid/list to update (wait for notification or DOM change)
    // Wait for notification to appear and disappear
    await page.waitForSelector('.notification.success', { timeout: 4000 });
    await page.waitForSelector('.notification.success', { state: 'detached', timeout: 4000 });

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_filtered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_filtered.png'));

    // --- Extract product prices to verify filter applied ---
    // Try grid view first, then list view if grid not found
    let productCards = await page.$$('.products-grid .product-card');
    if (productCards.length === 0) {
      productCards = await page.$$('.products-list .product-card-list');
    }

    const extractedPrices = [];
    for (let i = 0; i < productCards.length; i++) {
      const priceEl = await productCards[i].$('div.product-price');
      if (priceEl) {
        const priceText = await priceEl.textContent();
        // Extract price using regex
        const match = priceText.match(/\$([0-9,.]+)/);
        if (match) {
          extractedPrices.push(parseFloat(match[1].replace(/,/g, '')));
        }
      }
    }

    // Check that all prices are within the filter range
    const minPrice = 500;
    const maxPrice = 1300;
    const allWithinRange = extractedPrices.length > 0 && extractedPrices.every(p => p >= minPrice && p <= maxPrice);

    return {
      success: allWithinRange,
      action: "Applied price range filter and verified all displayed products are within the selected price range.",
      extractedData: {
        filteredPrices: extractedPrices,
        filterMin: minPrice,
        filterMax: maxPrice,
        allWithinRange
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
